import React from 'react';
import Presentacion from './pages/LandingPage';
import Proyectos from './pages/Proyectos';
import Habilidades from './pages/Habilidades';

function App() {
  return (
    <div style={{ scrollBehavior: 'smooth' }}>
      <Presentacion />
      <Proyectos />
      <Habilidades />
    </div>
  );
}

export default App;
